import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import {
  DocumentTextIcon,
  ClipboardDocumentCheckIcon,
  BellIcon,
  ExclamationCircleIcon,
  CheckCircleIcon,
} from '@heroicons/react/24/outline';
import api from '../services/api';

interface DashboardStats {
  documents: {
    total: number;
    byType: Record<string, number>;
    byStatus: Record<string, number>;
  };
  compliance: {
    total: number;
    compliant: number;
    nonCompliant: number;
  };
  alerts: {
    pending: number;
    acknowledged: number;
  };
}

const Dashboard = () => {
  const [stats, setStats] = useState<DashboardStats | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    fetchDashboardStats();
  }, []);

  const fetchDashboardStats = async () => {
    try {
      const response = await api.get('/users/stats');
      setStats(response.data);
      setError(null);
    } catch (err) {
      console.error('Error fetching dashboard stats:', err);
      setError('Failed to load dashboard data');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex h-full items-center justify-center">
        <div className="h-32 w-32 animate-spin rounded-full border-b-2 border-gray-900"></div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="rounded-md bg-red-50 p-4">
        <div className="flex">
          <ExclamationCircleIcon className="h-5 w-5 text-red-400" aria-hidden="true" />
          <div className="ml-3">
            <h3 className="text-sm font-medium text-red-800">Error</h3>
            <div className="mt-2 text-sm text-red-700">
              <p>{error}</p>
            </div>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="mx-auto max-w-7xl px-4 sm:px-6 lg:px-8">
      {/* Stats Overview */}
      <div className="mt-8">
        <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-3">
          {/* Document Stats */}
          <div className="overflow-hidden rounded-lg bg-white shadow">
            <div className="p-5">
              <div className="flex items-center">
                <div className="flex-shrink-0">
                  <DocumentTextIcon className="h-6 w-6 text-gray-400" aria-hidden="true" />
                </div>
                <div className="ml-5 w-0 flex-1">
                  <dl>
                    <dt className="truncate text-sm font-medium text-gray-500">Total Documents</dt>
                    <dd className="mt-1 text-3xl font-semibold text-gray-900">
                      {stats?.documents.total || 0}
                    </dd>
                  </dl>
                </div>
              </div>
              <div className="mt-4">
                <Link
                  to="/documents"
                  className="text-sm font-medium text-indigo-600 hover:text-indigo-500"
                >
                  View all documents →
                </Link>
              </div>
            </div>
          </div>

          {/* Compliance Stats */}
          <div className="overflow-hidden rounded-lg bg-white shadow">
            <div className="p-5">
              <div className="flex items-center">
                <div className="flex-shrink-0">
                  <ClipboardDocumentCheckIcon className="h-6 w-6 text-gray-400" aria-hidden="true" />
                </div>
                <div className="ml-5 w-0 flex-1">
                  <dl>
                    <dt className="truncate text-sm font-medium text-gray-500">Compliance Status</dt>
                    <dd className="mt-1 flex items-baseline">
                      <div className="flex items-center text-2xl font-semibold text-green-600">
                        {stats?.compliance.compliant || 0}
                        <span className="ml-2 text-sm font-medium text-gray-500">compliant</span>
                      </div>
                      <div className="ml-4 flex items-center text-2xl font-semibold text-red-600">
                        {stats?.compliance.nonCompliant || 0}
                        <span className="ml-2 text-sm font-medium text-gray-500">non-compliant</span>
                      </div>
                    </dd>
                  </dl>
                </div>
              </div>
              <div className="mt-4">
                <Link
                  to="/compliance"
                  className="text-sm font-medium text-indigo-600 hover:text-indigo-500"
                >
                  View compliance checks →
                </Link>
              </div>
            </div>
          </div>

          {/* Alerts Stats */}
          <div className="overflow-hidden rounded-lg bg-white shadow">
            <div className="p-5">
              <div className="flex items-center">
                <div className="flex-shrink-0">
                  <BellIcon className="h-6 w-6 text-gray-400" aria-hidden="true" />
                </div>
                <div className="ml-5 w-0 flex-1">
                  <dl>
